/* global fetch */
import React, {Component} from 'react';

class TodoList extends Component {
    constructor(props){
      super(props);
      this.state = {
        todos:[]
      }
    }

    componentWillMount(){
      fetch('/api/todos')
      .then(data => data.json())
      .then(todos => this.setState({todos}));
    }
    render(){

      return (
        <div>
        <h1> TodoList! </h1>
        <h2>{this.state.todos} </h2>
        </div>
        )


    }
}

export default TodoList;
